/**
 * @param {number[]} nums1
 * @param {number[]} nums2
 * @param {number} diff
 * @return {number}
 */
//59 / 61 个通过测试用例
var numberOfPairs2 = function(nums1, nums2, diff) {
    let n = nums1.length;
    let sum = 0;
    for(let i = 0; i < n; i++) {
        for(let j = i + 1; j < n; j++) {
            if(nums1[i] - nums1[j] <= nums2[i] - nums2[j] + diff ) {
                sum++;
            }
        }
    }
    return sum;
};

var Node = function(){
    this.left = null;
    this.right = null;
    this.val = null;
    this.add = null;
}

var SegmentTreeDynamic = function(){
    this.N = 10 ** 6;
    this.root = new Node();

    this.update = function(node, start, end, l, r, val) {
        if (l <= start && end <= r) {
            node.val += (end - start + 1) * val;
            node.add += val;
            return ;
        }
        let mid = (start + end) >> 1;
        this.pushDown(node, mid - start + 1, end - mid);
        if (l <= mid) this.update(node.left, start, mid, l, r, val);
        if (r > mid) this.update(node.right, mid + 1, end, l, r, val);
        this.pushUp(node);
    }

    this.query = function(node, start, end, l, r) {
        //console.log(`query ${l} ${r}`);
        if (l <= start && end <= r) return node.val;
        let mid = (start + end) >> 1, ans = 0;
        this.pushDown(node, mid - start + 1, end - mid);
        if (l <= mid) ans += this.query(node.left, start, mid, l, r);
        if (r > mid) ans += this.query(node.right, mid + 1, end, l, r);
        return ans;
    }
    this.pushUp = function(node) {
        node.val = node.left.val + node.right.val;
    }
    this.pushDown = function( node,  leftNum, rightNum) {
        if (node.left == null) node.left = new Node();
        if (node.right == null) node.right = new Node();
        if (node.add == 0) return ;
        node.left.val += node.add * leftNum;
        node.right.val += node.add * rightNum;
        // 对区间进行「加减」的更新操作，下推懒惰标记时需要累加起来，不能直接覆盖
        node.left.add += node.add;
        node.right.add += node.add;
        node.add = 0;
    }
}

//41 / 61 个通过测试用例
//PASS log(n)
var numberOfPairs = function(nums1, nums2, diff) {
    let n = nums1.length;
    let sum = 0;
    let nums3 = new Array(n).fill(0);
    for(let i = 0; i < n; i++) {
        nums3[i] = nums1[i] - nums2[i];
    }

    let segTree = new SegmentTreeDynamic();
    for(let i = 0; i < n; i++) {
        let curr = segTree.query(segTree.root, 0, segTree.N, 0, nums3[i] + diff + 10 ** 5);
        sum += curr;
        segTree.update(segTree.root, 0, segTree.N, 10 ** 5 + nums3[i], 10 ** 5 + nums3[i], 1);
        //console.log(`sum ${sum} ${curr}`)
    }
    return sum;
};

